import { connect} from "react-redux"; 
import {withRouter} from "react-router-dom";
import { actionCreators } from "../actions/profile";


const RightContent =() =>{

    const [inpval , setInpval] = useState({
    firstName: "",
    lastName: "",
    telephone: "",
    age: 28,
    email: "",
    state: "",
    // country: "",
