const handleChange =(e) =>{

const{name , value} = e.target;
setInpval(prev =>(
    {
        ...prev,
        [name] : value
    }
));

}

      return (
        <div>
            <form>
          <h1>Registration Form </h1>
          <label htmlFor="firstname">First Name : </label>
          <input type ="text" placeholder="Enter First Name" value ={inpval.firstName} onChange={handleChange}></input>
 <br></br> <br></br>
          <label htmlFor="lastname">Last Name : </label>
          <input type ="text" placeholder="Enter Last Name" value = {inpval.lastName} onChange={handleChange}></input>
          <br></br> <br></br>
          <label htmlFor="phone">Telephone : </label>
          <input type ="text" placeholder="Enter phone no."  value = {inpval.telephone} onChange={handleChange}></input>
          <br></br> <br></br>
          <label htmlFor="age">Age: </label>
          <input type ="number" placeholder="Enter age" value = {inpval.age} onChange={handleChange}></input>
          <br></br> <br></br>
          <label htmlFor="email"> Email: </label>
          <input type ="email" placeholder="Enter email"  value = {inpval.email} onChange={handleChange}></input>
          <br></br> <br></br>
          <label htmlFor="phone">State : </label>
          <input type ="text" placeholder="Enter state"  value = {inpval.state} onChange={handleChange}></input>
          <br></br>
          <br></br>
          <button className="btn btn-primary" >Register</button>
          </form>
        </div>
      )

}
export default RightContent
